import logo from './logo.svg';
import './App.css';
import useCart from './CartPage';
import CheckoutPage from './CheckoutPage';

function App() {
  const {render, subTotalPrice, totalPrice} = useCart();
  return (
    <div style={{height:"100vh", display:'flex', flexDirection:'row'}}>
      <div style={{width:'70%'}}>
        <CheckoutPage {...{subTotalPrice, totalPrice}}/>
      </div>
      <div style={{width:'30%', padding:'5%'}}>
          {render}
      </div>
    </div>
  );
}

export default App;
